import './styles.css';

import { TZDateMini } from "@date-fns/tz";
import { isWithinInterval, setHours, setMinutes } from "date-fns";

const POPUP_START_HOUR = 11;
const POPUP_START_MINUTE = 52;
const POPUP_END_HOUR = 12;
const POPUP_END_MINUTE = 8;
const timeZone = "Europe/Belgrade";

function shouldShowPopup() {
    const now = new TZDateMini(new Date(), timeZone);
    const popupOnTime = setMinutes(setHours(now, POPUP_START_HOUR), POPUP_START_MINUTE);
    const popupOffTime = setMinutes(setHours(now, POPUP_END_HOUR), POPUP_END_MINUTE);
    return isWithinInterval(now, {start: popupOnTime, end: popupOffTime});
}

window.onload = function () {
    if (!shouldShowPopup()) {
        return;
    }
    const div = document.createElement('div');
    div.id = 'rsvk';

    const text = tr();

    let rsvkMain = document.createElement('div')
    rsvkMain.innerHTML = `
     <div class="rsvk-overlay">
        <div class="rsvk-popup">
            <div class="rsvk-popup-content">
                <img src="data:image/png;base64," alt="" />
                <div class="rsvk-popup-content-text">
                <h1>11:52 - 12:08 CEST</h1>
                ${text}
                    
                </div>
                <div class="rsvk-popup-footer">
                    <p>Powered by <a href="https://github.com/shellmonk/rsvk">rsvk</a></p>
                </div>
            </div>
        </div>
    </div>
    `

    document.body.appendChild(rsvkMain);
}


let tr = () => {
    const locale = new Intl.Locale(navigator.language).baseName.split('-')[0];
    if(locale == 'sr') {
        return trSr();
    } else {
        return trEn();
    }
}

let trSr = () => {
    return `<h1>Mi podržavamo studentske proteste protiv korupcije u Srbiji!</h1>
    <a href="https://en.wikipedia.org/wiki/2024%E2%80%932025_Serbian_anti-corruption_protests">Više informacija</a>
    <a href="https://podrzistudente.org/">Podrži</a>`
}

let trEn = () => {
    return `<h1>We support anti-corruption student protests in Serbia!</h1>
    <a href="https://en.wikipedia.org/wiki/2024%E2%80%932025_Serbian_anti-corruption_protests">More info</a>
    <a href="https://podrzistudente.org/">Support</a>`
}
